// src/App.js
import React from 'react';
import { BrowserRouter as Router, Link } from 'react-router-dom';
import Routes from './routes/routes';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Aplikacija za lov</h1>
          <div className="Menu">
            <Link to="/popis-lovaca" className="Button">EVIDENCIJA LOVACA</Link>
            <Link to="/raspored-aktivnosti" className="Button">RASPORED AKTIVNOSTI I LOVA</Link>
            <Link to="/popis-lova" className="Button">EVIDENCIJA PRISUTNOSTI NA LOVNI DAN</Link>
            <Link to="/unos-divljaci" className="Button">UNOS DIVLJAČI</Link>
            <Link to="/unos-odstrijela" className="Button">UNOS ODSTRIJELENE DIVLJAČI</Link>
            <Link to="/popis-bodova" className="Button">BODOVI</Link>
          </div>
        </header>
        <Routes />
      </div>
    </Router>
  );
}

export default App;
